import React from 'react';
import { Layout } from '../componets/Layout';
import SKILLSFRONT  from '../img/SKILLSFRONT.png'
import SkillSoft  from '../img/SkillSoft.png'

export const AboutPage = () =>{
  return(
    <Layout>
  <img className='skillFront' src={SKILLSFRONT} alt="skills" />
  <img className='skillSoft' src={SkillSoft} alt="skills" />
    </Layout>
  )
}
